import React, { useState, useEffect, useRef, useCallback } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import { FaUser, FaBars, FaTimes, FaHome, FaTachometerAlt, FaSignOutAlt, FaUserCircle } from 'react-icons/fa';
import './Navbar.css';

const Navbar = () => {
  const navigate = useNavigate();
  const [isLoggedIn, setIsLoggedIn] = useState(false);
  const [showPopover, setShowPopover] = useState(false);
  const [showMobileMenu, setShowMobileMenu] = useState(false);
  const [user, setUser] = useState(null);
  const popoverRef = useRef(null);
  const mobileMenuRef = useRef(null);

  const checkAuthStatus = useCallback(() => {
    const userData = localStorage.getItem('user');
    const token = localStorage.getItem('token');

    if (userData && token) {
      setIsLoggedIn(true);
      setUser(JSON.parse(userData));
    } else {
      setIsLoggedIn(false);
      setUser(null);
    }
  }, []);

  useEffect(() => {
    checkAuthStatus();
    window.addEventListener('userLogin', checkAuthStatus);
    window.addEventListener('storage', checkAuthStatus);

    return () => {
      window.removeEventListener('userLogin', checkAuthStatus);
      window.removeEventListener('storage', checkAuthStatus);
    };
  }, [checkAuthStatus]);

  useEffect(() => {
    const handleClickOutside = (event) => {
      if (popoverRef.current && !popoverRef.current.contains(event.target)) {
        setShowPopover(false);
      }
      if (mobileMenuRef.current && !mobileMenuRef.current.contains(event.target)) {
        setShowMobileMenu(false);
      }
    };

    document.addEventListener('mousedown', handleClickOutside);
    return () => document.removeEventListener('mousedown', handleClickOutside);
  }, []);

  const handleLogout = () => {
    localStorage.removeItem('token');
    localStorage.removeItem('user');
    setIsLoggedIn(false);
    setUser(null);
    setShowPopover(false);
    setShowMobileMenu(false);
    window.dispatchEvent(new Event('userLogin'));
    navigate('/');
  };

  const handleViewProfile = () => {
    setShowPopover(false);
    setShowMobileMenu(false);
    navigate('/profile');
  };

  const handleNavigation = (path) => {
    setShowMobileMenu(false);
    navigate(path);
  };

  return (
    <nav className="navbar">
      <div className="navbar-container">
        <div className="navbar-brand">
          <Link to="/">
            <span className="brand-icon">üç±</span>
            <span className="brand-name">Tiffin Service</span>
          </Link>
        </div>

        <button 
          className="mobile-menu-button"
          onClick={() => setShowMobileMenu(!showMobileMenu)}
          aria-label="Toggle menu"
        >
          {showMobileMenu ? <FaTimes /> : <FaBars />}
        </button>

        <div className={`navbar-links ${showMobileMenu ? 'active' : ''}`} ref={mobileMenuRef}>
          <Link to="/" className="nav-link" onClick={() => setShowMobileMenu(false)}>
            <FaHome className="nav-icon" />
            <span>Home</span>
          </Link>

          {isLoggedIn && user && (
            <Link 
              to={user.userType === 'admin' ? '/admin/dashboard' : '/member/dashboard'} 
              className="nav-link"
              onClick={() => setShowMobileMenu(false)}
            >
              <FaTachometerAlt className="nav-icon" />
              <span>Dashboard</span>
            </Link>
          )}
        </div>

        <div className="navbar-auth">
          {isLoggedIn && user ? (
            <div className="profile-menu" ref={popoverRef}>
              <button 
                className="profile-button"
                onClick={() => setShowPopover(!showPopover)}
              >
                <div className="profile-avatar">
                  {user.name ? user.name[0].toUpperCase() : 'U'}
                </div>
                <div className="profile-info">
                  <span className="profile-name">{user.name || 'User'}</span>
                  <span className="profile-email">{user.email || 'user@email.com'}</span>
                </div>
              </button>

              {showPopover && (
                <div className="profile-dropdown">
                  <Link to="/profile" className="dropdown-item" onClick={() => setShowPopover(false)}>
                    <FaUserCircle />
                    <span>My Profile</span>
                  </Link>
                  <button className="dropdown-item danger" onClick={handleLogout}>
                    <FaSignOutAlt />
                    <span>Sign Out</span>
                  </button>
                </div>
              )}
            </div>
          ) : (
            <div className="auth-buttons">
              <Link to="/login" className="btn btn-secondary" onClick={() => setShowMobileMenu(false)}>
                Sign In
              </Link>
              <Link to="/signup" className="btn btn-primary" onClick={() => setShowMobileMenu(false)}>
                Sign Up
              </Link>
            </div>
          )}
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
